import Container from 'react-bootstrap/Container';

function HeaderComponent({content}) {
    return (
        <header className="pageHeader">
            <Container className='d-flex flex-column justify-content-center'>
                    {content.map((index) => (
                        <Nav.Link key={index} className='me-2 ms-2 ms-lg-0 my-2 my-lg-0 text-dark' href={content.title}><span className='me-2'>{content.subtitle}</span></Nav.Link>
                    ))}
                <h1>{content.title}</h1>
                {content.title !== "" ? <p>{content.subtitle}</p> : ""}
            </Container>
        </header>
    );
}

export default HeaderComponent;
